import React from 'react'
// import styles from './Header.module.css';
import { CSSTransition } from 'react-transition-group';
// import PropTypes from 'prop-types'
import './Header.css';

const Header = () => (
        <CSSTransition 
            in={true}
            appear={true}
            timeout={5000}
            classNames="maintitle">
            <header>
                <h1>Phonebook</h1>
            </header>
        </CSSTransition>
    )

export default Header
